import { NavLink } from "react-router-dom";

const Navbar = () => {

  return (
    <div class="full-nav">
      <div class="nav-1">
          <a href="/">trang-do-thuy</a>
      </div>

    <div className="nav-2">
      <div class="nav-box">
        <NavLink 
          to={"/"}
          style={ ({isActive}) => (
          isActive ? linkStyles.activeLink : linkStyles.defaultLink
        )}>
          _hello
        </NavLink>
      </div>

      <div class="nav-box">
        <NavLink
          to="/"
          style={ ({isActive}) => (
              isActive ? linkStyles.activeLink : linkStyles.defaultLink
              )}>
        _about-me
        </NavLink>
      </div>

      <div class="nav-box">
        <NavLink
          to="/"
          style={ ({isActive}) => (
              isActive ? linkStyles.activeLink : linkStyles.defaultLink
              )}>
        _projects
        </NavLink>
      </div>
      </div>

      <div class="nav-3">
        {/* <div><p>fhu</p></div> */}
        <div class="nav-box">
          <NavLink
          to="/"
          style={ ({isActive}) => (
              isActive ? linkStyles.activeLink : linkStyles.defaultLink
              )}>
          _contact-me
          </NavLink>
        </div>
      </div>
    </div>
      );


}

export default Navbar;

const linkStyles = {
  activeLink: {
    color: "white",
  },
  defaultLink: {
    textDecoration: "none",
    color: "white",
  },
};
